import styles from './ReportForm.module.css'
//表单处理
import { useForm, SubmitHandler } from "react-hook-form"
import EventIcon from '@material-ui/icons/Event';
import { FormControl, FormLabel, RadioGroup, FormControlLabel, TextField, InputLabel, Input, IconButton, InputAdornment } from '@material-ui/core';
import Radio from '@material-ui/core/Radio';
import { Visibility, VisibilityOff } from '@material-ui/icons';
import { Form } from 'antd';

import React, { useState } from 'react';
import { IFormInput, TextFieldInfo, ActionTypeEnum, OtherOptionEnum } from './data';
import { request } from 'http';



function ReportForm({ open, onCancel }: { open: boolean, onCancel: any }) {
    return (
        <div onClick={onCancel} className={styles.box} style={{ display: open ? 'block' : 'none' }}>
            <div onClick={(e) => { e.stopPropagation() }} className={styles.contentBox}>
                <FormDisabledDemo />
            </div>
        </div>
    )
}

export default ReportForm;


const FormDisabledDemo: React.FC = () => {

    const [actionType, setActionType] = useState("1");
    const { register, handleSubmit } = useForm<IFormInput>();

    const onSubmit: SubmitHandler<IFormInput> = (data) => {
        console.log("onSubmit==", data)
    }
    //自定义输入框需要记录值
    const [values, setValues] = React.useState({
        //安全信息接收日期
        infoGetDate: '2022/09/08',
        //有效日期
        validDate: '',
        //疾病类型
        diseaseType: '',
        //使用剂量
        DOSAGER: '',
        //批号
        lotNumber: ''
    });
    //自定义输入框事件处理
    const [tfAction, setTfAction] = React.useState({
        //是否展示安全信息接收日期选择日历
        isShowCalendar1: false,
        //是否展示有效日期选择日历
        isShowValidDateCalendar: false,
        //有效日期不详?
        validDateUnknown: false,
        //疾病类型不详?
        diseaseTypeUnknown: false,
        //使用剂量不详?
        DOSAGERUnknown: false,
        //批号不详?
        lotNumberUnknown: false

    })




    const projectTFs = () => {
        return (
            <>
                {/*  */}
                <TextField
                    {...register("infoReceiveDate",
                        { required: true })}
                    color="secondary"
                    id="infoReceiveDate"
                    label="* 该机构是什么时候接收到安全性信息的（年/月/日）？"
                    type="date"
                    defaultValue="2020/9/11"
                    style={{ ...{ width: "57%" }, ...{ marginBottom: 10, paddingRight: 10 } }}
                    InputLabelProps={{
                        shrink: true,
                    }}
                />
                <TextField
                    {...register("orgName",
                        { required: true })}
                    required
                    style={{ ...{ width: "33%" }, ...{ marginBottom: 10, paddingRight: 10 } }}
                    color="secondary"
                    id="reporterNo"
                    label={<div style={{ fontSize: 13, float: 'left' }}>* 项目名称/机构编号</div>}
                    defaultValue="压力测试号"
                />
                <TextField
                    {...register("reporterNo",
                        { required: true })}
                    required
                    style={{ ...{ width: "30%" }, ...{ marginBottom: 10, paddingRight: 10 } }}
                    color="secondary"
                    id="reporterNo"
                    label={<div style={{ fontSize: 13, float: 'left' }}>* 报告者识别号</div>}
                    defaultValue="yuanqiao"
                />
                <TextField
                    {...register("orgAddress",
                        { required: true })}
                    required
                    style={{ ...{ width: "30%" }, ...{ marginBottom: 10, paddingRight: 10 } }}
                    color="secondary"
                    id="orgAddress"
                    label={<div style={{ fontSize: 13, float: 'left' }}>* 机构名称和地址</div>}
                    defaultValue="NA"
                />
                <TextField
                    {...register("itemNumber",
                        { required: true })}
                    required
                    style={{ ...{ width: "30%" }, ...{ marginBottom: 10, paddingRight: 10 } }}
                    color="secondary"
                    id="itemNumber"
                    label={<div style={{ fontSize: 13, float: 'left' }}>
                        * 项目编号/活动识别号
                    </div>}
                    defaultValue="NA"
                />
                <TextField
                    {...register("WISECode",
                        { required: true })}
                    required
                    style={{ ...{ width: "30%" }, ...{ marginBottom: 10, paddingRight: 10 } }}
                    color="secondary"
                    id="WISECode"
                    label={<div style={{ fontSize: 13, float: 'left' }}>
                        * WISE编码（针对市场研究项目）
                    </div>}
                    defaultValue="NA"
                />
                <TextField
                    {...register("orgTel",
                        { required: true })}
                    required
                    style={{ ...{ width: "30%" }, ...{ marginBottom: 10, paddingRight: 10 } }}
                    color="secondary"
                    id="orgTel"
                    label={<div style={{ fontSize: 13, float: 'left' }}>
                        * 机构电话
                    </div>}
                    defaultValue="NA"
                />
                <TextField
                    {...register("ChimAERa",
                        { required: true })}
                    required
                    style={{ ...{ width: "30%" }, ...{ marginBottom: 10, paddingRight: 10 } }}
                    color="secondary"
                    id="ChimAERa"
                    label={<div style={{ fontSize: 13, float: 'left' }}>
                        * ChimAERa编码（针对患者支持项目）
                    </div>}
                    defaultValue="NA"
                />
                <TextField
                    {...register("orgEmail",
                        { required: true })}
                    required
                    style={{ ...{ width: "30%" }, ...{ marginBottom: 10, paddingRight: 10 } }}
                    color="secondary"
                    id="orgEmail"
                    label={<div style={{ fontSize: 13, float: 'left' }}>
                        * 机构电邮
                    </div>}
                    defaultValue="NA"
                />
                <TextField
                    {...register("orgLtdContact",
                        { required: true })}
                    required
                    style={{ ...{ width: "30%" }, ...{ marginBottom: 10, paddingRight: 10 } }}
                    color="secondary"
                    id="orgLtdContact"
                    label={<div style={{ fontSize: 13, float: 'left' }}>
                        * 机构联系人姓名
                    </div>}
                    defaultValue="NA"
                />
                <TextField
                    {...register("orgSignatureDate",
                        { required: true })}
                    required
                    style={{ ...{ width: "30%" }, ...{ marginBottom: 10, paddingRight: 10 } }}
                    color="secondary"
                    id="orgSignatureDate"
                    label={<div style={{ fontSize: 13, float: 'left' }}>
                        "* 机构联系人签名和日期"
                    </div>}
                    defaultValue="NA"
                />
            </>
        );
    }

    const medicineTFs = (() => {

        return (
            <>
                <TextField
                    {...register("eventID",
                        { required: true })}
                    required
                    style={{ ...{ width: "45%" }, ...{ marginBottom: 10, paddingRight: 10 } }}
                    color="secondary"
                    id="eventID"
                    label={<div style={{ fontSize: 13, float: 'left' }}>
                        * 事件编号（系统内部编号）
                    </div>}
                    defaultValue=""
                />
                <TextField
                    {...register("eventProductName",
                        { required: true })}
                    style={{ ...{ width: "45%" }, ...{ marginBottom: 10, paddingRight: 10 } }}
                    color="secondary"
                    id="eventProductName"
                    label={<div style={{ fontSize: 13, float: 'left' }}>
                        * 安全性信息是关于哪种葛兰素史克产品？
                    </div>}
                    defaultValue=""
                />
                <TextField
                    {...register("validDate", { required: true })}
                    color="secondary"
                    id="validDate"
                    label={<div style={{ fontSize: 13, float: 'left' }}>
                        * 有效日期
                    </div>}
                    type='date'
                    defaultValue=''
                    InputLabelProps={{ shrink: true }}
                    style={{ ...{ width: "45%" }, ...{ marginBottom: 10, paddingRight: 10 } }}

                />
                <TextField
                    {...register("productSymptom",
                        { required: true })}
                    style={{ ...{ width: "45%" }, ...{ marginBottom: 10, paddingRight: 10 } }}
                    color="secondary"
                    id="productSymptom"
                    label={<div style={{ fontSize: 13, float: 'left' }}>
                        * 该产品用于什么适应症（疾病）？"
                    </div>}
                    defaultValue=""

                />

                <FormControl 
                required 
                style={{ ...{ width: "45%" }, ...{ marginBottom: 10, paddingRight: 10 } }}
                color="secondary"

                >
                    <InputLabel htmlFor="standard-adornment-password">Password</InputLabel>
                    <Input
                        {...register('ChimAERa')}
                        id="productSymptom"
                        type="text"
                        value="123"
                        endAdornment={
                            <InputAdornment position="end">
                                <IconButton
                                    aria-label="toggle password visibility"
                                    onClick={()=>{setTestIcon(!testIcon)}}
                                >
                                    {testIcon ? <Visibility /> : <VisibilityOff />}
                                </IconButton>
                                <FormLabel component="legend" 
                                style={{ color: '#666', fontSize: 14, marginBottom: 0, marginRight: 20, borderBottom: "0", width: 'auto', height: '40px', lineHeight: '40px' }}
                                >不详</FormLabel>
                            </InputAdornment>
                        }
                    />
                </FormControl>

                <TextField
                    {...register("useDose",
                        { required: true })}
                    style={{ ...{ width: "45%" }, ...{ marginBottom: 10, paddingRight: 10 } }}
                    color="secondary"
                    id="useDose"
                    label={<div style={{ fontSize: 13, float: 'left' }}>
                        * 使用剂量（文字描述）
                    </div>}
                    defaultValue=""
                />
                <TextField
                    {...register("lotNumber",
                        { required: true })}
                    style={{ ...{ width: "45%" }, ...{ marginBottom: 10, paddingRight: 10 } }}
                    color="secondary"
                    id="lotNumber"
                    label={<div style={{ fontSize: 13, float: 'left' }}>
                        * 批号
                    </div>}
                    defaultValue=""
                />
            </>
        )
        //
        //有效日期





    })
    const [testIcon, setTestIcon] = useState(true);

    return (
        <>
            <Form onSubmitCapture={handleSubmit(onSubmit)}>
                <div className={styles.title1}>GSK 不良事件报告表</div>
                <div className={styles.title2}>机构/项目信息</div>
                <FormControl className={styles.formControl} component="fieldset">
                    <div className={styles.actionTypeBox}>
                        <RadioGroup row aria-label="actionType" name="actionType" defaultValue={"1"}>
                            <FormLabel component="legend" style={{ color: '#666', fontSize: 14, marginBottom: 0, marginRight: 20, borderBottom: "0", width: 'auto', height: '40px', lineHeight: '40px' }}>*活动类型</FormLabel>
                            <FormControlLabel labelPlacement="end" value="1" style={{ height: 40 }} control={<Radio />} label={<div style={{ color: '#666', fontSize: 14 }}>市场研究</div>} />
                            <FormControlLabel labelPlacement="end" value="2" style={{ height: 40 }} control={<Radio />} label={<div style={{ color: '#666', fontSize: 14 }}>患者支持项目</div>} />
                            <FormControlLabel labelPlacement="end" value="3" style={{ height: 40 }} control={<Radio />} label={<div style={{ color: '#666', fontSize: 14 }}>数字媒体</div>} />
                        </RadioGroup>
                    </div>
                </FormControl>

                <div className={styles.subContent}>
                    {projectTFs()}
                </div>

                <div className={styles.title2} style={{ marginBottom: 0 }}>药物和安全性信息</div>
                <div className={styles.subContent} style={{ marginTop: 0 }}>
                    {medicineTFs()}
                </div>
            </Form>

        </>
    );
};


const currentStyle = {
    tfStyle: { width: "53%", marginBottom: 10, paddingRight: 10 }
}
